import React from "react";
import "./Chef_img_card.css";


const Chef_img_card: React.FC = () => {
      return (<>
        <img className="chef_card" src="https://static.vecteezy.com/packs/media/vectors/term-bg-1-3d6355ab.jpg" />
        </>
      )
    }

export default Chef_img_card;
